import React, { useState } from 'react';
import { Link, useLocation } from 'react-router-dom';
import {
  AppBar,
  Box,
  Toolbar,
  IconButton,
  Typography,
  Badge,
  Container,
  Button,
  Drawer,
  List,
  ListItem,
  ListItemText,
  ListItemIcon,
} from '@mui/material';
import {
  Menu as MenuIcon,
  Home as HomeIcon,
  ShoppingCart as CartIcon,
  Close as CloseIcon,
} from '@mui/icons-material';
import { useProduct } from '../context/ProductContext';

const Navbar = () => {
  const [mobileOpen, setMobileOpen] = useState(false);
  const { cart } = useProduct();
  const location = useLocation();
  const isMobile = window.innerWidth < 600;

  const handleDrawerToggle = () => {
    setMobileOpen(!mobileOpen);
  };

  const pages = [
    { name: 'Home', path: '/' },
    { name: 'Cart', path: '/cart' },
  ];

  const drawer = (
    <Box sx={{ width: 250, bgcolor: 'background.paper' }}>
      <Box sx={{ p: 2, display: 'flex', alignItems: 'center', justifyContent: 'space-between' }}>
        <Typography variant="h6" sx={{ color: 'primary.main' }}>
          Cosmos Shop
        </Typography>
        <IconButton onClick={handleDrawerToggle}>
          <CloseIcon />
        </IconButton>
      </Box>
      <List>
        {pages.map((page) => (
          <ListItem
            key={page.name}
            button
            component={Link}
            to={page.path}
            onClick={handleDrawerToggle}
            selected={location.pathname === page.path}
            sx={{
              '&.Mui-selected': {
                bgcolor: 'rgba(0, 180, 216, 0.1)',
                '&:hover': {
                  bgcolor: 'rgba(0, 180, 216, 0.2)',
                },
              },
            }}
          >
            <ListItemIcon sx={{ color: 'primary.main' }}>
              {page.name === 'Home' ? <HomeIcon /> : <CartIcon />}
            </ListItemIcon>
            <ListItemText 
              primary={page.name}
              sx={{ 
                '& .MuiTypography-root': {
                  color: 'text.primary',
                }
              }}
            />
          </ListItem>
        ))}
      </List>
    </Box>
  );

  return (
    <AppBar 
      position="sticky" 
      sx={{ 
        bgcolor: 'background.paper',
        borderBottom: '1px solid rgba(255,255,255,0.1)',
        boxShadow: '0 4px 20px rgba(0,0,0,0.1)',
      }}
    >
      <Container maxWidth="xl">
        <Toolbar disableGutters>
          <IconButton
            color="inherit"
            aria-label="open drawer"
            edge="start"
            onClick={handleDrawerToggle}
            sx={{ mr: 2, display: { sm: 'none' }, color: 'text.primary' }}
          >
            <MenuIcon />
          </IconButton>

          <Box sx={{ display: 'flex', alignItems: 'center', flexGrow: 1 }}>
            <Typography
              variant="h6"
              noWrap
              component={Link}
              to="/"
              sx={{
                mr: 2,
                fontWeight: 700,
                color: 'primary.main',
                textDecoration: 'none',
                letterSpacing: '.1rem',
              }}
            >
              COSMOS SHOP
            </Typography>
            {!isMobile && (
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 2 }}>
                {pages.map((page) => (
                  <Button
                    key={page.name}
                    component={Link}
                    to={page.path}
                    startIcon={page.name === 'Home' ? <HomeIcon /> : <CartIcon />}
                    sx={{
                      color: location.pathname === page.path ? 'primary.main' : 'text.primary',
                      '&:hover': {
                        color: 'primary.main',
                      },
                    }}
                  >
                    {page.name}
                  </Button>
                ))}
              </Box>
            )}
          </Box>

          <Box sx={{ flexGrow: 0 }}>
            <IconButton
              component={Link}
              to="/cart"
              sx={{ color: location.pathname === '/cart' ? 'primary.main' : 'text.primary' }}
            >
              <Badge 
                badgeContent={cart.reduce((total, item) => total + item.quantity, 0)} 
                color="primary"
                sx={{
                  '& .MuiBadge-badge': {
                    bgcolor: 'cosmic.nebula',
                  },
                }}
              >
                <CartIcon />
              </Badge>
            </IconButton>
          </Box>
        </Toolbar>
      </Container>
      <Drawer
        variant="temporary"
        anchor="left"
        open={mobileOpen}
        onClose={handleDrawerToggle}
        ModalProps={{
          keepMounted: true,
        }}
        sx={{
          display: { xs: 'block', sm: 'none' },
          '& .MuiDrawer-paper': {
            boxSizing: 'border-box',
            width: 250,
            bgcolor: 'background.paper',
            borderRight: '1px solid rgba(255,255,255,0.1)',
          },
        }}
      >
        {drawer}
      </Drawer>
    </AppBar>
  );
};

export default Navbar;
